import React, { useState } from "react";
import { Button, ButtonGroup, ToggleButton } from "react-bootstrap";
import Optionbtn from "../btnOption";
function Question() {
  const [checked, setChecked] = useState(false);
  return (
    <div className="d-flex flex-column w-100">
      <div className="Quizheader mb-2">Question # 1:</div>
      <div className="QuizQuestion">Who was quaid-e-azam?</div>
      <div className="QuizContent">
        <Optionbtn text="A.Option" checked={true} />
        <Optionbtn text="B.Option" checked={false}/>
        <Optionbtn text="C.Option" checked={true}/>
        <Optionbtn text="D.Option" checked={true}/>
        <Optionbtn text="E.Option" checked={true}/>
        <Optionbtn text="F.Option" checked={true}/>
        <Optionbtn text="G.Option" checked={true}/>

        <div className="centered">
          <Button className="quizbtn w-25">Previous</Button>
          <Button className="quizbtn w-25">{"Next"}</Button>
        </div>
      </div>
    </div>
  );
}

export default Question;
